import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import { bookingAPI, getImageURL } from '../../services/api';
import './MyBookings.css';

function MyBookings() {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [isAdmin, setIsAdmin] = useState(false);

  const fetchBookings = useCallback(async () => {
    try {
      setLoading(true);
      
      // Check if user is logged in
      const user = localStorage.getItem('user');
      if (!user) {
        navigate('/login');
        return;
      }

      const userData = JSON.parse(user);
      
      // Check if user is admin
      const userIsAdmin = userData.email === 'admin@wallartgo.com' || 
                          userData.username === 'admin' ||
                          userData.role === 'admin';
      
      setIsAdmin(userIsAdmin);
      console.log('üîç User is admin:', userIsAdmin);
      console.log('üë§ User data:', userData);

      // Fetch bookings (backend handles admin vs user logic)
      const response = await bookingAPI.getUserBookings();
      console.log('‚úÖ Bookings response:', response.data);
      
      setBookings(response.data.data || []);
      setLoading(false);
    } catch (error) {
      console.error('‚ùå Error fetching bookings:', error);
      setError('Failed to load bookings');
      setLoading(false);
    }
  }, [navigate]);

  useEffect(() => {
    fetchBookings();
  }, [fetchBookings]);

  const getStatusColor = (status) => {
    switch(status?.toLowerCase()) {
      case 'confirmed':
        return '#27ae60';
      case 'completed':
        return '#3498db';
      case 'cancelled':
        return '#e74c3c';
      default:
        return '#f39c12';
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  const formatTime = (timeString) => {
    if (!timeString) return 'N/A';
    return timeString;
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading bookings...</p>
      </div>
    );
  }

  return (
    <div className="my-bookings-container">
      <div className="bookings-header">
        <div>
          <h1>{isAdmin ? 'üëë All Bookings (Admin)' : 'My Bookings'}</h1>
          <p>{isAdmin ? 'View and manage all customer bookings' : 'View your booking history'}</p>
        </div>
        <button className="back-btn" onClick={() => navigate('/')}>
          ‚Üê Back to Home
        </button>
      </div>

      {error && (
        <div className="error-message">
          <span className="error-icon">‚ö†Ô∏è</span>
          <span>{error}</span>
        </div>
      )}

      {bookings.length === 0 ? (
        <div className="no-bookings">
          <div className="no-bookings-icon">üìÖ</div>
          <h2>{isAdmin ? 'No Bookings Yet' : 'You haven\'t made any bookings yet'}</h2>
          <p>{isAdmin ? 'No customers have made bookings yet.' : 'Start exploring our collection and book your favorite artwork!'}</p>
          {!isAdmin && (
            <button className="browse-btn" onClick={() => navigate('/')}>
              Browse Artworks
            </button>
          )}
        </div>
      ) : (
        <div className="bookings-grid">
          {bookings.map((booking) => (
            <div key={booking.booking_id} className="booking-card">
              <div className="booking-card-header">
                <span className="booking-id">Booking #{booking.booking_id}</span>
                <span 
                  className="booking-status"
                  style={{ backgroundColor: getStatusColor(booking.status) }}
                >
                  {(booking.status || 'pending').toUpperCase()}
                </span>
              </div>

              <div className="booking-artwork">
                <img 
                  src={getImageURL(booking.image_url)} 
                  alt={booking.artwork_title}
                  onError={(e) => {
                    e.target.src = 'https://via.placeholder.com/150x180?text=No+Image';
                  }}
                />
                <div className="booking-artwork-info">
                  <h3>{booking.artwork_title}</h3>
                  <p className="booking-artist">By {booking.artist_name}</p>
                  <p className="booking-price">NPR {Number(booking.total_amount || booking.artwork_price || 0).toLocaleString()}</p>
                </div>
              </div>

              <div className="booking-divider"></div>

              {isAdmin && (
                <div className="booking-customer-info">
                  <h4>Customer Details</h4>
                  <div className="info-row">
                    <span className="info-label">Name:</span>
                    <span className="info-value">{booking.customer_name}</span>
                  </div>
                  <div className="info-row">
                    <span className="info-label">Email:</span>
                    <span className="info-value">{booking.email}</span>
                  </div>
                  <div className="info-row">
                    <span className="info-label">Phone:</span>
                    <span className="info-value">{booking.phone}</span>
                  </div>
                  <div className="booking-divider"></div>
                </div>
              )}

              <div className="booking-details">
                <div className="detail-item">
                  <span className="detail-icon">üìÖ</span>
                  <div>
                    <span className="detail-label">Date</span>
                    <span className="detail-value">
                      {formatDate(booking.preferred_date)}
                    </span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üïê</span>
                  <div>
                    <span className="detail-label">Time</span>
                    <span className="detail-value">{formatTime(booking.preferred_time)}</span>
                  </div>
                </div>

                {!isAdmin && (
                  <div className="detail-item">
                    <span className="detail-icon">üìß</span>
                    <div>
                      <span className="detail-label">Email</span>
                      <span className="detail-value">{booking.email}</span>
                    </div>
                  </div>
                )}

                <div className="detail-item">
                  <span className="detail-icon">üìç</span>
                  <div>
                    <span className="detail-label">Address</span>
                    <span className="detail-value">{booking.delivery_address}</span>
                  </div>
                </div>
              </div>

              {booking.special_instructions && (
                <>
                  <div className="booking-divider"></div>
                  <div className="booking-notes">
                    <h4>Special Instructions</h4>
                    <p>{booking.special_instructions}</p>
                  </div>
                </>
              )}

              <div className="booking-footer">
                <span className="booking-date">
                  Booked on: {formatDate(booking.created_at)}
                </span>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default MyBookings;
